import React, { useState, useEffect } from 'react';
import axios from 'axios';
import heic2any from 'heic2any';
import imageCompression from 'browser-image-compression';
import { signInWithEmailAndPassword, createUserWithEmailAndPassword, signOut } from 'firebase/auth';
import { auth } from './firebase-client';
import AddTreeForm from './components/AddTreeForm';  // ✅ Import the AddTreeForm component

// Utility functions
function normalizeName(name) {
    // Remove special characters and extra spaces
    name = name
        .replace(/[^\w\s]/g, '')
        .replace(/\s+/g, ' ')
        .trim()
        .toLowerCase();

    // Extract class year
    const classOfMatch = name.match(/\bclass of (\d{4})\b/);
    const classOfYear = classOfMatch ? classOfMatch[1] : null;

    // Remove class of year from name
    name = name.replace(/\bclass of \d{4}\b/g, '').trim();

    // Handle last name, first name format
    if (name.includes(',')) {
        const [lastName, firstName] = name.split(',').map(part => part.trim());
        name = `${firstName} ${lastName}`;
    } else {
        const parts = name.split(' ');
        if (parts.length > 1) {
            // If multiple words, assume last word is first name
            const lastName = parts.slice(0, -1).join(' ');
            const firstName = parts[parts.length - 1];
            name = `${firstName} ${lastName}`;
        }
    }

    // Add class year back if exists
    if (classOfYear) {
        name = `${name} class of ${classOfYear}`;
    }

    return name;
}

module.exports = { normalizeName };

function formatNameForDisplay(name) {
    return name
        .split(' ')
        .map(word => word.charAt(0).toUpperCase() + word.slice(1))
        .join(' ');
}

// AuthForm Component
function AuthForm({ type, onSubmit, error }) {
    const [email, setEmail] = useState('');
    const [password, setPassword] = useState('');
    const [firstName, setFirstName] = useState('');
    const [secondName, setSecondName] = useState('');
    const [year, setYear] = useState('');

    const handleSubmit = (e) => {
        e.preventDefault();
        onSubmit(email, password, firstName, secondName, year);
    };

    return (
        <form onSubmit={handleSubmit}>
            <h2>{type === 'login' ? 'Login' : 'Sign Up'}</h2>
            <input type="email" placeholder="Email" value={email} onChange={(e) => setEmail(e.target.value)} required />
            <input type="password" placeholder="Password" value={password} onChange={(e) => setPassword(e.target.value)} required />
            {type === 'signup' && (
                <>
                    <input type="text" placeholder="First Name" value={firstName} onChange={(e) => setFirstName(e.target.value)} required />
                    <input type="text" placeholder="Second Name" value={secondName} onChange={(e) => setSecondName(e.target.value)} required />
                    <input type="text" placeholder="Year (e.g., 2026)" value={year} onChange={(e) => setYear(e.target.value)} required />
                </>
            )}
            <button type="submit">{type === 'login' ? 'Login' : 'Sign Up'}</button>
            {error && <p style={{ color: 'red' }}>{error}</p>}
        </form>
    );
}

// Main App Component
function App() {

    const [name, setName] = useState('');
    const [data, setData] = useState(null);
    const [error, setError] = useState('');
    const [user, setUser] = useState(null);

    // Handles user sign-up
    const handleSignUp = async (email, password, firstName, secondName, year) => {
        try {
            const userCredential = await createUserWithEmailAndPassword(auth, email, password);
            const user = userCredential.user;
            const fullName = `${firstName} ${secondName} - Class of ${year}`;
            const normalizedName = normalizeName(fullName);
            setName(normalizedName);
            setUser(user);
        } catch (err) {
            console.error('Sign-up failed:', err);
            setError('Sign-up failed. Please try again.');
        }
    };

    // Handles user login
    const handleLogin = async (email, password, firstName, secondName, year) => {
        try {
            const userCredential = await signInWithEmailAndPassword(auth, email, password);
            const user = userCredential.user;
            const fullName = `${firstName} ${secondName} - Class of ${year}`;
            const normalizedName = normalizeName(fullName);
            setName(normalizedName);
            setUser(user);
        } catch (err) {
            console.error('Login failed:', err);
            setError('Login failed. Please check your credentials.');
        }
    };

    // Handles user logout
    const handleLogout = async () => {
        try {
            await signOut(auth);
            setUser(null);
            setName('');
            setData(null);
        } catch (err) {
            console.error('Logout failed:', err);
            setError('Logout failed. Please try again.');
        }
    };

    // Fetch user's planted trees
    useEffect(() => {
        if (name) {
            const fetchData = async () => {
                try {
                  const token = await user?.getIdToken();
                  const response = await fetch('http://localhost:5000/api/trees/search', {
                    method: 'POST',
                    headers: {
                      'Content-Type': 'application/json',
                      ...(token && { 'Authorization': `Bearer ${token}` })
                    },
                    body: JSON.stringify({ name: "tserakhava anastasiya class of 2026" })
                  });

                  if (!response.ok) throw new Error(`HTTP error! status: ${response.status}`);
                  const data = await response.json();
                  console.log("Search results:", data);
                } catch (error) {
                  console.error('Fetch error:', error);
                }
              };
            fetchData();
        } else {
            setData({ results: [] });
        }
    }, [name, user]);
    // Handle new tree addition (refresh tree list)
    const handleTreeAdded = async () => {
        if (name) {
            try {
                const response = await axios.post('http://localhost:5000/api/search', { name });
                setData(response.data);
            } catch (err) {
                console.error('Error refreshing trees:', err);
            }
        }
    };

    return (
        <div style={{ padding: '20px' }}>
            <h1>Tree Tracking App</h1>

            {!user ? (
                <>
                    <AuthForm type="signup" onSubmit={handleSignUp} error={error} />
                    <AuthForm type="login" onSubmit={handleLogin} error={error} />
                </>
            ) : (
                <div>
                    <p>Welcome, {formatNameForDisplay(name)}!</p>
                    <button onClick={handleLogout}>Logout</button>

                    {/* Form to add new trees */}
                    <AddTreeForm user={user} onTreeAdded={handleTreeAdded} />

                    {/* Display user's planted trees */}
                    {data && (
                        <div>
                            <h2>My Planted Trees</h2>
                            <table border="1" cellPadding="10" style={{ marginTop: '20px' }}>
                                <thead>
                                    <tr>
                                        <th>#</th>
                                        <th>Date</th>
                                        <th>Location</th>
                                        <th>GPS Coordinates</th>
                                        <th>Type of Activity</th>
                                        <th>Species</th>
                                        <th>Remarks</th>
                                        <th>Tree Image</th>
                                    </tr>
                                </thead>
                                <tbody>
                                    {data.results.map((row, index) => (
                                        <tr key={index}>
                                            <td>{row.num}</td>
                                            <td>{row.date}</td>
                                            <td>{row.location}</td>
                                            <td>{row.gpsCoordinates}</td>
                                            <td>{row.typeOfActivity}</td>
                                            <td>{row.species}</td>
                                            <td>{row.remarks}</td>
                                            <td>
                                                {row.treeImage && (
                                                    <img src={row.treeImage} alt="Tree" style={{ width: '100px', height: 'auto' }} />
                                                )}
                                            </td>
                                        </tr>
                                    ))}
                                </tbody>
                            </table>
                        </div>
                    )}
                </div>
            )}
        </div>
    );
}

export default App;
